from typing import List

import collections
class Solution:
    def highestPeak(self, isWater: List[List[int]]) -> List[List[int]]:
        queue = collections.deque()
        m = len(isWater)
        n = len(isWater[0])

        land = [ [-1 for j in range(n)] for i in range(m) ]
        visit = [ [0 for j in range(n)] for i in range(m) ]
        for i in range(m):
            for j in range(n):
                if isWater[i][j]:
                    queue.append((i,j))
                    land[i][j] = 0
                    visit[i][j] = 1

        dir = [(-1,0), (0,1), (1,0), (0,-1)]
        maxh = 0
        cnt = 0
        while len(queue) > 0:
            cord = queue.popleft()
            #print(queue)
            minh = 9999999999999999
            cnt+=1
            for d in dir:
                y = cord[0] + d[0]
                x = cord[1] + d[1]
                if 0<= y <m and 0 <= x < n:
                    if land[y][x] == -1 and visit[y][x] == 0:
                        queue.append((y,x))
                        visit[y][x] = 1
                    if land[y][x] > -1:
                        minh = min(minh,land[y][x])

            if land[cord[0]][cord[1]] !=0:
                land[cord[0]][cord[1]] = minh+1
                maxh = max(maxh,minh+1)
            print(cnt)


        return land
